var script_f39_36_40513=[" ",
"",
"var calctxt = '';",
"var xmltxt = '';",
"var htmtxt = '';",
"",
"",
"function PressureUlcerRisk_fx() {",
"with(document.PressureUlcerRisk_form){",
"",
"Score = 0.0;",
"doCalc = true;",
"",
"if (cc1[0].checked){",
"Score = Score + 1;",
"}",
"if (cc1[1].checked){",
"Score = Score + 2;",
"}",
"if (cc1[2].checked){",
"Score = Score + 3;",
"}",
"if (cc1[3].checked){",
"Score = Score + 4;",
"}",
"if (cc2[0].checked){",
"Score = Score + 1;",
"}",
"if (cc2[1].checked){",
"Score = Score + 2;",
"}",
"if (cc2[2].checked){",
"Score = Score + 3;",
"}",
"if (cc2[3].checked){",
"Score = Score + 4;",
"}",
"if (cc3[0].checked){",
"Score = Score + 1;",
"}",
"if (cc3[1].checked){",
"Score = Score + 2;",
"}",
"if (cc3[2].checked){",
"Score = Score + 3;",
"}",
"if (cc3[3].checked){",
"Score = Score + 4;",
"}",
"if (cc4[0].checked){",
"Score = Score + 1;",
"}",
"if (cc4[1].checked){",
"Score = Score + 2;",
"}",
"if (cc4[2].checked){",
"Score = Score + 3;",
"}",
"if (cc4[3].checked){",
"Score = Score + 4;",
"}",
"if (cc5[0].checked){",
"Score = Score + 1;",
"}",
"if (cc5[1].checked){",
"Score = Score + 2;",
"}",
"if (cc5[2].checked){",
"Score = Score + 3;",
"}",
"if (cc5[3].checked){",
"Score = Score + 4;",
"}",
"if (cc6[0].checked){",
"Score = Score + 1;",
"}",
"if (cc6[1].checked){",
"Score = Score + 2;",
"}",
"if (cc6[2].checked){",
"Score = Score + 3;",
"}",
"cctotal.value = Score;",
"",
"if (doCalc){",
"rrclr();",
"if ((Score >= 17) && (Score <= 23)){ document.getElementById('rr1_1').bgColor = '#cccccc';",
"}",
"if ((Score >= 15) && (Score <= 16)){ document.getElementById('rr1_2').bgColor = '#cccccc';",
"}",
"if ((Score >= 13) && (Score <= 14)){ document.getElementById('rr1_3').bgColor = '#cccccc';",
"}",
"if ((Score >= 0) && (Score <= 12)){ document.getElementById('rr1_4').bgColor = '#cccccc';",
"}",
"",
"}",
"}",
"}",
"",
"",
"",
"",
"function rrclr(){",
"document.getElementById('rr1_1').bgColor = \"\";",
"document.getElementById('rr1_2').bgColor = \"\";",
"document.getElementById('rr1_3').bgColor = \"\";",
"document.getElementById('rr1_4').bgColor = \"\";",
"}",
"",
"",
""].join("\n");
