"     <a class=\"medical medical_patient\" href=\"mobipreview.htm?16/63/17396?source=related_link\">",
"      Patient information: Non-small cell lung cancer treatment; stage IV cancer (Beyond the Basics)",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"mobipreview.htm?14/29/14809?source=related_link\">",
"      Personalized, genotype-directed therapy for advanced non-small cell lung cancer",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"mobipreview.htm?33/8/33924?source=related_link\">",
"      Radiation therapy for the management of painful bone metastases",
"     </a>",
