var title_f39_36_40524="Antidotes pediatric poisoning A";
var content_f39_36_40524=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F70409&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F70409&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Recommended antidotes in pediatric poisonings",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Antidote",
"       </td>",
"       <td class=\"subtitle1\">",
"        Poisoning indication",
"       </td>",
"       <td class=\"subtitle1\">",
"        Pediatric dose",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        N-acetylcysteine",
"       </td>",
"       <td>",
"        Acetaminophen",
"       </td>",
"       <td>",
"        <p>",
"         Oral Loading dose: 140 mg/kg orally; oral maintenance doses: 70 mg/kg every four hours for 17 doses",
"        </p>",
"        <p>",
"         Intravenous (IV)&nbsp;administration: 150mg/kg over 1 hour (loading dose); 50 mg/kg IV over 4 hours; 100 mg/kg IV over 16 hours",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Atropine",
"       </td>",
"       <td>",
"        Carbamate insecticide",
"       </td>",
"       <td rowspan=\"2\">",
"        0.02 mg/kg IV bolus (0.1 mg minimum dose; maximum single dose 0.5 mg for children and 1.0 mg for adolescents) repeat doses titrated to effect",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Organophosphate insecticide",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Crotalid antivenin",
"       </td>",
"       <td>",
"        Crotalid snakes",
"       </td>",
"       <td>",
"        4 to 6 vials (more if severe)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Calcium gluconate and calcium chloride (10 percent)",
"       </td>",
"       <td>",
"        Calcium channel blocker",
"       </td>",
"       <td rowspan=\"2\">",
"        Gluconate: 100 to 200 mg/kg IV Chloride: 20 to 30 mg/kg IV repeat doses and IV infusions are common",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hydrogen fluoride (HF)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cyanide antidote kit (may contain sodium nitrite 3 percent ,sodium thiosulfate, and/or hydroxocobalamin)",
"       </td>",
"       <td>",
"        Cyanide",
"       </td>",
"       <td>",
"        <p>",
"         Sodium thiosulfate: 400 mg/kg IV (maximum 12.5 grams)",
"        </p>",
"        <p>",
"         Hydroxocobalamin: 70 mg/kg IV (maximum 5 grams)",
"        </p>",
"        <p>",
"         Sodium nitrite: 6 mg/kg by slow IV infusion (maximum 300 mg, only give if",
"         <strong>",
"          not",
"         </strong>",
"         contraindicated and hydroxocobolamin is",
"         <strong>",
"          not",
"         </strong>",
"         available), refer to UpToDate topics on cyanide poisoning",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Deferoxamine",
"       </td>",
"       <td>",
"        Iron",
"       </td>",
"       <td>",
"        5 to 15 mg/kg per hour IV infusion, titrated to effect",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        Digoxin immune Fab",
"       </td>",
"       <td>",
"        Digoxin",
"       </td>",
"       <td rowspan=\"3\">",
"        Empiric dosing: 10 to 20 vials IV bolus fo life-threatening toxicity; see package insert for other dosing regimens",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Digitoxin",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Natural product (eg, plants, toads)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        Dimercaprol (BAL, British antilewisite)",
"       </td>",
"       <td>",
"        Acute arsenic",
"       </td>",
"       <td rowspan=\"3\">",
"        2.5 to 4 mg/kg IM",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Inorganic mercury",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lead (with encephalopathy)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Dart, RC, Goldfrank, LR, Chyka, PA, Lotzer, D. Combined evidence-based literature analysis and consensus guidelines for stocking of emergency antidotes in the United States. Ann Emerg Med 2000; 36:126 and Clinical policy for the initial approach to patients presenting with acute toxic ingestion or dermal or inhalation exposure. Ann Emerg Med 1999; 33:735.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f39_36_40524=[""].join("\n");
