var title_f39_36_40525="Inhalation anthrax Rx";
var content_f39_36_40525=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F74184&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F74184&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Treatment of inhalation anthrax associated with bioterrorism*",
"    <sup>",
"     &bull;&Delta;&loz;",
"    </sup>",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup width=\"20%\">",
"     </colgroup>",
"     <colgroup span=\"2\" width=\"40%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Drug regimen",
"       </td>",
"       <td class=\"subtitle1\">",
"        Duration",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        <strong>",
"         Adults",
"        </strong>",
"       </td>",
"       <td>",
"        <p>",
"         Ciprofloxacin 400 mg IV every 12 hrs (preferred agent)*",
"         <sup>",
"          &bull;",
"         </sup>",
"        </p>",
"        <p>",
"         <strong>",
"          OR",
"         </strong>",
"        </p>",
"        <p>",
"         Doxycycline 100 mg IV every 12 hrs (only in patients with a major contraindication to ciprofloxacin)",
"         <sup>",
"          &loz;",
"         </sup>",
"        </p>",
"        <p>",
"         <strong>",
"          AND",
"         </strong>",
"        </p>",
"        <p>",
"         One or two additional antimicrobials",
"         <sup>",
"          &sect;",
"         </sup>",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         IV treatment initially",
"         <sup>",
"          &yen;",
"         </sup>",
"         . Switch to oral antimicrobial therapy when clinically appropriate:",
"        </p>",
"        <p>",
"         Ciprofloxacin 500 mg orally twice daily",
"        </p>",
"        <p>",
"         <strong>",
"          OR",
"         </strong>",
"        </p>",
"        <p>",
"         Doxycycline 100 mg orally twice daily",
"        </p>",
"        <p>",
"         Continue for 60 days (IV and PO combined)",
"         <sup>",
"          ",
"         </sup>",
"        </p>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        <strong>",
"         Children",
"        </strong>",
"       </td>",
"       <td>",
"        <p>",
"         Ciprofloxacin 10 mg/kg IV every 12 hrs [not to exceed 400 mg/dose] (preferred agent)",
"         <sup>",
"          ",
"         </sup>",
"        </p>",
"        <p>",
"         <strong>",
"          OR",
"         </strong>",
"        </p>",
"        <p>",
"         Doxycycline (only in patients with a major contraindication to ciprofloxacin):",
"        </p>",
"        <p>",
"         &gt;8 yrs old and &gt;45 kg: 100 mg IV every 12 hrs",
"        </p>",
"        <p>",
"         &gt;8 yrs old and &le;45 kg: 2.2 mg/kg IV every 12 hrs",
"        </p>",
"        <p>",
"         &le;8 yrs old: 2.2 mg/kg IV every 12 hrs",
"        </p>",
"        <p>",
"         <strong>",
"          AND",
"         </strong>",
"        </p>",
"        <p>",
"         One or two additional antimicrobials",
"         <sup>",
"          &sect;",
"         </sup>",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         IV treatment initially",
"         <sup>",
"          &yen;",
"         </sup>",
"         . Switch to oral antimicrobial therapy when clinically appropriate:",
"        </p>",
"        <p>",
"         Ciprofloxacin 15 mg/kg orally twice daily*",
"         <sup>",
"          &yen;",
"         </sup>",
"        </p>",
"        <p>",
"         <strong>",
"          OR",
"         </strong>",
"        </p>",
"        <p>",
"         Doxycycline:",
"         <sup>",
"          &bull;",
"         </sup>",
"        </p>",
"        <p>",
"         &gt;8 yrs old and &gt;45 kg: 100 mg orally twice daily",
"        </p>",
"        <p>",
"         &gt;8 yrs old and &le;45 kg: 2.2 mg/kg orally twice daily",
"        </p>",
"        <p>",
"         &le;8 yrs old: 2.2 mg/kg orally twice daily",
"        </p>",
"        <p>",
"         Continue for 60 days (IV and PO combined)",
"         <sup>",
"          ",
"         </sup>",
"        </p>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        <strong>",
"         Pregnant women",
"        </strong>",
"        **",
"       </td>",
"       <td>",
"        Same for nonpregnant adults (the high death rate from the infection outweighs the risk posed by the antimicrobial agent); ciprofloxacin strongly preferred over doxycycline",
"       </td>",
"       <td>",
"        Same for nonpregnant adults",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Immunocompromised persons",
"        </strong>",
"       </td>",
"       <td>",
"        Same for immunocompetent persons and children",
"       </td>",
"       <td>",
"        Same for immunocompetent persons and children",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Important note: For gastrointestinal and oropharyngeal anthrax, use regimens recommended for inhalational anthrax.",
"     <br/>",
"     <span class=\"bullet\">",
"      &bull;",
"     </span>",
"     Ciprofloxacin should be considered an essential part of first-line therapy for inhalational anthrax.",
"     <br/>",
"     &Delta; Glucocorticoids may be considered as an adjunct therapy for patients with severe edema or meningitis based on experience with bacterial meningitis of other etiologies.",
"     <br/>",
"     <span class=\"lozenge\">",
"      &loz;",
"     </span>",
"     In cases with proven meningeal involvement, intravenous therapy with ciprofloxacin plus TWO agents with good CNS penetration (meropenem or imipenem, rifampin, vancomycin, penicillin or ampicillin) and in vitro activity against B. anthracis are recommended.",
"     <br/>",
"     &sect; Additional intravenous antimicrobials with in vitro activity include rifampin, vancomycin, penicillin, ampicillin, chloramphenicol, imipenem, meropenem, clindamycin. At least one of the agents should have good CNS penetration and in vitro activity against B. anthracis (meropenem, imipenem, rifampin, vancomycin, penicillin or ampicillin) due to the potential for clinical or subclinical meningeal involvement. Clindamycin is often suggested as a third agent due to its potential inhibition of toxin production.",
"     <br/>",
"     &yen; Initial therapy may be altered based on clinical response; one or two antimicrobial agents (eg, ciprofloxacin or doxycycline) may be adequate as the patient improves.",
"     <br/>",
"     &Dagger; Because of the potential persistence of spores after an aerosol exposure, antimicrobial therapy should be continued for 60 days.",
"     <br/>",
"     &dagger; If intravenous ciprofloxacin is not available, oral ciprofloxacin may be acceptable because it is rapidly and well absorbed from the gastrointestinal tract with no substantial loss by first-pass metabolism. Maximum serum concentrations are attained 1-2 hours after oral dosing but may not be achieved if vomiting or ileus are present.",
"     <br/>",
"     ** Although doxycycline is not usually recommended during pregnancy, its use may be indicated for life-threatening illness. Adverse effects on developing teeth and bones are dose-related; therefore, doxycycline might be used for a short time (7-14 days) before 6 months of gestation.",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Update: Investigation of bioterrorism-related anthrax and interim guidelines for exposure management and antimicrobial therapy, October 2001. MMWR Morb Mortal Wkly Rep 2001; 50:909 and",
"     <br/>",
"     Update: Interim recommendations for antimicrobial prophylaxis for children and breastfeeding mothers and treatment of children with anthrax. MMWR Morb Mortal Wkly Rep 2001; 50:1014 and",
"     <br/>",
"     Updated recommendations for antimicrobial prophylaxis among asymptomatic pregnant women after exposure to Bacillus anthracis. MMWR Morb Mortal Wkly Rep 2001; 50:960 and",
"     <br/>",
"     Stern EJ, Uhde KB, Shadomy SV, Messonnier N. Conference report on public health and clinical guidelines for anthrax [conference summary]. Emerg Infect Dis [serial on the Internet] 2008; 14. file://www.cdc.gov/EID/content/14/4/07-0969.htm (Accessed February 11, 2008).",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
